CREATE SCHEMA IF NOT EXISTS matteo_tef;

CREATE TABLE IF NOT EXISTS matteo_tef.tep_divided_results (
    id SERIAL PRIMARY KEY,
    trend_pre VARCHAR(100),
    event VARCHAR(10485760),
    trend_post VARCHAR(100),
    icustay_id INT4,
    vt_start_pre TIMESTAMPTZ,
    vt_end_pre TIMESTAMPTZ,
    vt TIMESTAMPTZ,
    vt_hour INT4,
    vt_start_post TIMESTAMPTZ,
    vt_end_post TIMESTAMPTZ,
    p1_value NUMERIC(10, 2),
    p2_value NUMERIC(10, 2),
    p3_value NUMERIC(10, 2),
    p4_value NUMERIC(10, 2),
    rows_pre INT8,
    rows_post INT8,
    slope_pre NUMERIC(10, 2),
    slope_pre_normalized NUMERIC(10, 2),
    slope_post NUMERIC(10, 2),
    duration_pre NUMERIC(10, 2),
    duration_post NUMERIC(10, 2),
    gap_pre NUMERIC(10, 2),
    gap_post NUMERIC(10, 2),
    deltax INT4,
    deltay FLOAT8,
    minnumberoftuples INT4,
    maxdeltavt INT4,
    maxdurationtime INT4,
    maxdeltastart INT4,
    max_steady_percentage NUMERIC(10, 2),
    influenced_by_event BOOLEAN,
    measure VARCHAR(10485760)
);

